import logo from './logo.svg';
import './App.css';
import Header from './component/Header/Header.js';
import LeftSide from './component/Leftside/LeftSide.js';
import MainContent from './component/MainContent/MainContent.js';
import { useState,useEffect } from 'react';
function App() {

  const [activeButton, setactiveButton] = useState('Notice');

  const handleButtonClick = (componentName) => {
    setactiveButton(componentName);
  };

  return (
    <div className="App">
      <Header onButtonClick={handleButtonClick}/>
      <div style={{
        display:"flex"
      }} >
      <LeftSide />
      <MainContent activeComponent={activeButton}/>
      </div>
    </div>
  );
}

export default App;
